Последствия сегодняшнего обстрела Украины ВС РФ:

— МВД Молдовы сообщило о падении обломков ракеты на севере страны;

— Харьков и область полностью обесточены в результате ракетного удара;

— Аварийные отключения электроэнергии введены в Винницкой и Черкасской областях Украины;

— Во Львовской области ВС РФ попали по объекту критической инфраструктуры. Власти предупредили о возможных перебоях со светом и водой.
